class RegisterComponent {
    constructor(validateService, authService, flashmessage, router) {
        this.validateService = validateService;
        this.authService = authService;
        this.flashmessage = flashmessage;
        this.router = router;
        this.name = "";
        this.username = "";
        this.email = "";
        this.password = "";
    }
    ngOnInit() {
    }
    onRegisterSubmit() {
        const user = {
            name: this.name,
            email: this.email,
            username: this.username,
            password: this.password
        };
        // console.log(user.name);
        if (!this.validateService.validateRegister(user)) {
            this.flashmessage.show("Please fill in all details", { cssClass: 'alert-danger', timeout: 3000 });
            return false;
        }
        if (!this.validateService.validateEmail(user.email)) {
            console.log(user.email);
            console.log("Please use a valid email");
            return false;
        }
        //Register
        this.authService.registerUser(user).subscribe(data => {
            if (data['success']) {
                this.flashmessage.show("User Registered", { cssClass: 'alert-success', timeout: 3000 });
                this.router.navigate(['/login']);
            }
            else {
                this.flashmessage.show("Something went wrong", { cssClass: 'alert-danger', timeout: 3000 });
                this.router.navigate(['/register']);
            }
        });
        return undefined;
    }
}
